import { auth  } from './Login/firebase.js'
import {Container,AppBar,Button,ToolBar} from '@material-ui/core'




class AdminApp extends Component
{
    render()
    {
        return(
                <AppBar position="static">
                   <ToolBar>
                     <Button color="inherit">
                            Logout
                     </Button>
                   </ToolBar>
                 </AppBar>
        )
    }
}

export default AdminApp;
